import React from "react";
import { Card, Form, Row, Col, Button, Layout } from "antd";
const Register = () => {
  // ./mill-eye-icon.png
  return (
    <Layout
      style={{
        backgroundColor: "",
        marginTop: "50px",
        borderRadius: 10,
        boxShadow: "2px 2px 2px 0",
      }}
    >
      <Row style={{padding: 10}} justify="center" align="middle">
        <Col span={10}>
          <img
            style={{ borderRadius: 10, boxShadow: "2px 2px 2px 0" }}
            src={`./mill-eye-icon.png`}
          />
          <h1>WellCome to Yuco</h1>
          <small>New Yugioh community...</small>
        </Col>
        <Col span={10}>
          <Card style={{ margin: 10 }} title={<h1>REGISTER ACCOUNT</h1>}>
            <div>tets</div>
          </Card>
        </Col>
      </Row>
    </Layout>
  );
};
export default Register;
